(1, '1 LO', 'Opiekunowie Projektu', 'prof. M. Chrabelski', '-', 'https://i.imgur.com/c5hHJWY.png', ''),
(26, 'Ciastolina', 'Firma trafiająca przez żołądek do portfela. Oferuje pyszne słodkości domowej roboty.', 'Nestii', '', '', ''),
(2, 'Loteria', 'Firma zajmująca się organizacją loterii!', 'Fernando_Riviera', '-', 'https://i.imgur.com/c5hHJWY.png', ''),
(25, 'Sąd', 'Instytucja zajmująca się wymierzaniem sprawiedliwości.', 'piterix', 'Nik0808', '', ''),
(16, 'Czarny Pijar', 'Gazetka Podstaw Przedsiębiorczości 1LO w Łodzi. Merytorycznie wprost idealna na posiedzenie w wc...', 'SoCuteLoli', '-', 'https://i.imgur.com/BZFWQcH.png', '- '),
(17, 'Bank', 'Bank', ' SoCuteLoli`  ', '-', '', ''),
(19, 'The Hedgehog Studios ', 'Masz pomysł na firmę, ale nie wiesz jak zacząć? A może potrzebujesz wybić się na rynku ale brak Ci odpowiednich środków? Potrzebujesz kogoś, kto zbuduje z Tobą fundamenty? Możemy to dla Ciebie zrobić!', 'Fernando_Riviera\'', 'wiktor.winiarski', '', ''),
(20, 'Biuro Patentowe', 'Firma zajmująca się odpłatnym oficjalnym udzielaniem patentów na wszelkie pomysły, projekty wynalazki itp. ', 'Fernando_Riviera`', '-', '', ''),
(37, 'Firma kartkówkowa', 'Firma zajmująca się robieniem kartkówek z prezentacji.', 'Zygfryd', '', '', ''),
(27, 'SZH', '<b>Sztos Ziomale Halibut</b><br> Oferujemy dla was:<br> <li><a href=\"premium.php\">Konta Premium</a></li> <li><a href=\"kuppjeski.php\">Abonament Pjeski</a></li>', 'Piotrek.Kietlinski', 'DawidG', 'vip.gif', ''),
(28, 'Urząd Statystyczny', 'Odpowiadają na najbardziej nurtujące pytania. Kto? Co? Kiedy? Dla kogo? I oczywiście za ile? Pieczołowicie dodają, odejmują, mnożą i dzielą, aby podzielić się ze wszystkimi informacjami od podszewki. Nie raz zadziwiają wszystkich dookoła, a ich raporty wywołują skrajne emocje. One - Julia Andrzejczak i Magda Ćmiel swoją ciężką pracą gwarantują profesjonalne statystyki, na które wszyscy czekają.', 'Julkaa', 'magdala12', '', ''),
(30, 'SolveIT', 'Celem firmy jest nauka oraz doskonalenie umiejętności układania kostki Rubika na czas w ramach indywidualnie przystosowanych krótkich kursów - nie tylko ze standardowej kostki 3x3 ale również 2x2, 4x4, Pyraminx, Square-1 oraz Megaminx.', 'McReseT', '', '', ''),
(31, 'Ręka Kopernika Przytrzymuje Pracownika (RKPP)', 'Nasza firma chce pomóc najbiedniejszym uczestnikom naszego projektu. Gdy w naszym projekcie pojawią się podatki, będzie możliwość oddania 1% swojego podatku dla naszych kolegów. Przewidziana jest także opcja imiennych datków i nagrody dla najhojniejszych darczyńców.', 'Asiaw', 'Panda100dolcow', '', ''),
(32, 'KAtharsis', 'Firma zajmująca się sprzedawaniem naklejek i wykonywaniem rysunków na zamówienie.', 'modrzewek', 'topinambur', '', ''),
(33, 'TestADMIN', 'test', 'TestDawidG', 'TestDawidG5', 'https://i.imgur.com/c5hHJWY.png', ''),
(35, 'Koper4Fun', 'Firma zajmująca się organizacją gier na lekcjach przedsiębiorczości.', 'AmandaaN', '', '', ''),
(36, 'Primavera', 'Firma zajmująca się tworzeniem i rozprowadzaniem kartek okolicznościowych na różne okazje.', 'Merida', '', '', ''),
(38, 'MWZ', 'Firma MWZ, wykupuje od prezentujących materiały do prezentacji. Tym samym podpisuje z nimi umowę o przekazanie praw do rozpowszechniania wspomnianych materiałów firmie. Następnie MWZ, za opłatą, daje dostęp do materiałów osobom zainteresowanym.', 'WeronikaW', '', '', ''),
(39, 'P&C', 'Nasza firma oferuje fantastyczne konkursy i wspaniałe nagrody!Nasza firma oferuje fantastyczne konkursy i wspaniałe nagrody!\r\nŻyczymy szczęścia i miłej zabawy!!!', 'Peter1234', 'Wagon123', 'depositphotos_179860718-stock-illustration-ferris-', ''),
